///Search for the position of a string inside of a string.
///
///* **Baseline**: Searching "abc123" inside of "1abc123"
///* **Big_Pattern**: Search for a 50kb string inside of "1" + the 50kb string. Chars for this string were random.
///* **Monotonous**: 50kb string of all 1s. Find "abc123" at the end.
///* **Almost**: 50kb string repeating "abc12" without the ending "3". Find "abc123" at the end of the string.
///
///Note: Aho Corasick was just shoehorned into here out of curiosity of performance against other searches.
///It does additional work which we expect will cause slower results: Searching for a set of strings against a set of strings. Its results provide both a "start" and "end" position of the match, along with which string it matched.
#[macro_use]
extern crate bencher;


static BASELINE: &[u8] = b"abc123";
static BASELINE1: &[u8] = b"1abc123";

static BIG_PATTERN: &[u8] = b"";
static BIG_SEARCH: &[u8] = b"";

static MONOTONOUS: &[u8] = b"";

static ALMOST: &[u8] = b"";

mod _galil_seiferas;
mod _jetscii;
mod _twoway;
mod _aho_corasick;
mod _subslice;

benchmark_group!(baseline, _galil_seiferas::baseline, _jetscii::baseline, _twoway::baseline, _aho_corasick::baseline, _subslice::baseline);
benchmark_group!(big_pattern, _galil_seiferas::big_pattern, _jetscii::big_pattern, _twoway::big_pattern, _aho_corasick::big_pattern, _subslice::big_pattern);
benchmark_group!(monotonous, _galil_seiferas::monotonous, _jetscii::monotonous, _twoway::monotonous, _aho_corasick::monotonous, _subslice::monotonous);
benchmark_group!(almost, _galil_seiferas::almost, _jetscii::almost, _twoway::almost, _aho_corasick::almost, _subslice::almost);

benchmark_main!(baseline, big_pattern, monotonous, almost);
